import "./App.css";
import React from "react";
import ChildList from "./component/ChildList";
import jsonData from "./babyNamesData.json";

function App() {
  const [inputText, setInputText] = useState("");
  function searchFunction(e) {
    const jsonData = jsonData.filter((x) => x.includes(e));
  }
  return (
    <div className="App">
      <input onChange={searchFunction}></input>
      <ChildList jsonArray={jsonData} label="Search" />
    </div>
  );
}

export default App;
